script: |
  super -f text -I q289.spq | sort > q289.out

inputs:
  - name: q289.spq
    data: |
      SELECT + - 42 + + CAST ( NULL AS REAL ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) NOT BETWEEN ( + col2 ) * col0 + CAST ( NULL AS INTEGER ) + 92 AND - col0;
  - name: tab0

outputs:
  - name: q289.out
    data: |
